def sigmoid(x):
    return 1 / (1 + np.exp(-x))

def tanh(x):
    return np.tanh(x)

def relu(x):
    return np.maximum(0, x)

def lstm_forward_batch_rally(X, kernel, recurrent_kernel, bias):
    batch_size, timesteps, input_dim = X.shape
    units = recurrent_kernel.shape[0]

    h = np.zeros((batch_size, units))
    c = np.zeros((batch_size, units))

    for t in range(timesteps):
        x_t = X[:, t, :]  # shape: (batch, input_dim)

        z = x_t @ kernel + h @ recurrent_kernel + bias  # shape: (batch, 4*units)

        i = sigmoid(z[:, :units])
        f = sigmoid(z[:, units:2*units])
        c_tilde = tanh(z[:, 2*units:3*units])
        o = sigmoid(z[:, 3*units:])

        c = f * c + i * c_tilde
        h = o * tanh(c)

    return h  # (batch, units)

def full_forward_batch_rally(X, weights):
    """
    X: (batch, 24, 39)
    Returns: (batch,) predictions
    """
    kernel, recurrent_kernel, bias = weights[0], weights[1], weights[2]
    W1, b1 = weights[3], weights[4]
    W2, b2 = weights[5], weights[6]
    W3, b3 = weights[7], weights[8]
    # LSTM layer
    h = lstm_forward_batch_rally(X, kernel, recurrent_kernel, bias)  # (batch, 32)

    # Dense 1
    x = relu(h @ W1 + b1)

    # Dense 2
    x = relu(x @ W2 + b2)

    # Dense 3 (output)
    out = x @ W3 + b3  # (batch, 1)

    return out[:, 0]


def lstm_forward(x, kernel, recurrent_kernel, bias):
    batch_size, time_steps, input_dim = x.shape
    units = recurrent_kernel.shape[0]  # 16
    
    h_t = np.zeros((batch_size, units))
    c_t = np.zeros((batch_size, units))

    # Unpack weights
    W_i, W_f, W_c, W_o = np.split(kernel, 4, axis=1)
    U_i, U_f, U_c, U_o = np.split(recurrent_kernel, 4, axis=1)
    b_i, b_f, b_c, b_o = np.split(bias, 4)

    for t in range(time_steps):
        x_t = x[:, t, :]  # (batch, input_dim)

        i = sigmoid(x_t @ W_i + h_t @ U_i + b_i)
        f = sigmoid(x_t @ W_f + h_t @ U_f + b_f)
        o = sigmoid(x_t @ W_o + h_t @ U_o + b_o)
        c_hat = tanh(x_t @ W_c + h_t @ U_c + b_c)

        c_t = f * c_t + i * c_hat
        h_t = o * tanh(c_t)

    return h_t  # final hidden state

def forward_pass(x, weights):
    # Unpack weights
    kernel, recurrent_kernel, bias = weights[0], weights[1], weights[2]
    W1, b1 = weights[3], weights[4]
    W2, b2 = weights[5], weights[6]

        # LSTM output
    lstm_out = lstm_forward(x, kernel, recurrent_kernel, bias)  # (batch, 16)

    # Dense 1
    dense1 = relu(np.dot(lstm_out, W1) + b1)  # (batch, 16)

    # Dense 2
    dense2 = sigmoid(np.dot(dense1, W2) + b2)  # (batch, 1)

    return dense2  # predicted value


def get_rnn_dataset(X):
    n = len(X)
    sequences = []
    for i in range(24, n):
        sequences.append(X[i-24:i])
    X_rnn = np.array(sequences)
    return X_rnn


