def preprocessing(anchor_data):
    anchor_dataset = anchor_data.dropna()
    anchor_dataset = np.log(anchor_dataset)
    def compute_rsi(series, period: int = 14):
        delta = series.diff()
        gain = delta.clip(lower=0)
        loss = -delta.clip(upper=0)
    
        avg_gain = gain.rolling(window=period, min_periods=period).mean()
        avg_loss = loss.rolling(window=period, min_periods=period).mean()
    
        rs = avg_gain / (avg_loss + 1e-10)  # add small value to avoid division by zero
        rsi = 100 - (100 / (1 + rs))
    
        return rsi


    anchors = ["BTC", "ETH", "SOL"]
    timeframes = ["1H", "4H", "1D"]
    for anchor in anchors:
        for timeframe in timeframes:
            suffix = f"_{anchor}_{timeframe}"
            if timeframe == "1H":
                anchor_dataset["volume-volume_14_ma" + suffix] = anchor_dataset["volume" + suffix]/anchor_dataset["volume" + suffix].rolling(14).mean()
                anchor_dataset["volatility" + suffix] = (anchor_dataset["high" + suffix] - anchor_dataset["low"+suffix]).rolling(5).mean()
                anchor_dataset["rsi_14_close"+suffix] = compute_rsi(anchor_dataset["close"+suffix], 14)
                anchor_dataset["rsi_7_close"+suffix] = compute_rsi(anchor_dataset["close"+suffix], 7)
            anchor_dataset["high-low_to_close" + suffix] = (anchor_dataset["high" + suffix] - anchor_dataset["low" + suffix])/anchor_dataset["close" + suffix]
            anchor_dataset["candle_body_size" + suffix] = abs(anchor_dataset["close" + suffix] - anchor_dataset["open" + suffix])/anchor_dataset["close" + suffix]
            anchor_dataset.drop(["volume"+suffix, "high"+suffix, "low"+suffix, "open"+suffix] , axis=1, inplace=True)
    return anchor_dataset.dropna()




